import styled from "@emotion/styled";

export default function Carousel() {
  return (
    <Container>
      <Box></Box>
    </Container>
  );
}

const Container = styled.div``;

const Box = styled.div`
  width: 190px;
  height: 221px;
  border-radius: 16px;
  background-color: gray;
`;
